function Layout() {
  const [allDecks,setAllDecks] = useState([]);
  const [currentDeck,setCurrentDeck] = useState({ cards: [] });

  return (
    <>
      <Header />
      <div className="container">
        <Switch>
          <Route path='/decks/:deckId/study'>
            <DeckList />
          </Route>
          <Route >
            <NotFound />
          </Route>
        </Switch>
      </div>
    </>
  );
}

export default Layout;
